import React from "react";
import Lap from "./Lap";

const Desktops = (props) => {
  return (
    <>
      {props.desktops.map((desktops, idx) => (
        <Lap key={idx} desktops={desktops} />
      ))}
    </>
  );
};

export default Desktops;
